void incspeed()
{
	speed++;
	if(speed>30)
		speed=30;
}
void decspeed()
{
	speed--;
	if(speed<1)
		speed=1;
}
void sleep1(int n)
{
	int i,j,k;
	for(i=0;i<n;i++)
		for(j=0;j<300;j++)
			for(k=0;k<200;k++);
}
void display();
void keyboard(unsigned char key,int x,int y)
{
	if(key=='S'){
		engine=1;
		speed = 1;
	}
	else if(key=='s'){
		for(int i =speed;i>0;i=i-0.5){
			sleep1(100);
			speed = i;
			display();

		}
		engine=0;
		speed = 0;
	}
	else if(key=='q')
		exit(0);
	else if(key=='a')
		incspeed();
	else if(key=='z')
		decspeed();
	else if (key=='c')
		showmenu = 210;
	glutPostRedisplay();
}
