void disp()
{
	if(day==1000)
		day=0;
	if(i<=2)
		i=1000;
	background();
	baseline();
	if(engine==1)
	{
	i-= speed+1; 
	}
	else
		i=i;
	city();
	obj(i);
	sun_effects();
	++day;
	sleep1(300);
	glutSwapBuffers();
	glutPostRedisplay();
}
void display()
{
	if(showmenu<200)
	{
		menu();
		sleep1(300);
	}
	else
		disp();
}
